import React from "react";
import "./index.css";


function BannerBox(props){
    return(
        <>
             <div className="box1">
                 <h2>{props.h2}</h2>
                 <p>{props.p}</p>
             </div>
        </>
    );
}
const TwoSecData=[
    {

        sorce:"/images/pic01.jpg",
        h2
    }
]
const BannerData=[
    {
        h2:"Aliquam",
        p:"Suspendisse amet ullamco",

    },
    {
        h2:"Elementum",
        p:"Class apetent taciti ad litora"
    },{
        h2:"Ultrices",
        p:"Nulla vitae mauris non felis"
    }
]
export default BannerData;
export {BannerBox};
